import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../style/App.css";

function ParttimeJob() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    qualification: "",
    nationality: "Indian",
    country: "",
    isStudent: "",
    college: "",
    collegeId: "",
    age: "",
    nightShift: "No",
    location: "",
    jobRole: "",
    time: "",
    salary: "",
  });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate("/jobresults", { state: { form } });
  };

  return (
    <div className="container">
      <h2>Find Part-time Jobs</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" name="qualification" placeholder="Qualification" onChange={handleChange} required />
        <select name="nationality" onChange={handleChange} value={form.nationality}>
          <option value="Indian">Indian</option>
          <option value="Other">Other</option>
        </select>
        {form.nationality === "Other" && (
          <input type="text" name="country" placeholder="Country" onChange={handleChange} />
        )}
        <select name="isStudent" onChange={handleChange}>
          <option value="">Are you a student?</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>
        {form.isStudent === "Yes" && (
          <>
            <input type="text" name="college" placeholder="College/University" onChange={handleChange} />
            <input type="text" name="collegeId" placeholder="College/University ID" onChange={handleChange} />
          </>
        )}
        <input type="number" name="age" placeholder="Age" onChange={handleChange} />
        <select name="nightShift" onChange={handleChange}>
          <option value="No">Comfortable with night shift?</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
        </select>
        <input type="text" name="location" placeholder="Preferred Location" onChange={handleChange} />
        <select name="jobRole" onChange={handleChange}>
          <option value="">Select Job Role</option>
          <option value="Tutor">Tutor</option>
          <option value="Cashier">Cashier</option>
          <option value="Delivery">Delivery</option>
          <option value="Waiter">Waiter</option>
          <option value="Data Entry">Data Entry</option>
        </select>
        <input type="text" name="time" placeholder="Preferred Time" onChange={handleChange} />
        <input type="number" name="salary" placeholder="Expected Salary" onChange={handleChange} />
        <button type="submit">Search Jobs</button>
      </form>
    </div>
  );
}

export default ParttimeJob;
